import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ResourceTable = () => {
  const [resources, setResources] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch the resource ID from the URL if it exists
  const instanceId = window.location.pathname.split('/')[3]; // Extract the ID from the URL path

  useEffect(() => {
    let apiUrl;

    if (instanceId) {
      // If an instance ID is provided, fetch that specific resource
      apiUrl = process.env.REACT_APP_BACKEND_URL + `/api/resources/${instanceId}`;
    } else {
      // If no instance ID is provided, fetch all resources
      apiUrl = process.env.REACT_APP_BACKEND_URL + '/api/resources';
    }

    // Fetch data from the backend
    axios.get(apiUrl)
      .then(response => {
        setResources(response.data);
        setLoading(false);
      })
      .catch(error => {
        setError('Failed to fetch resources');
        setLoading(false);
      });
  }, [instanceId]); // Dependency on instanceId so the effect runs when it's updated

  if (loading) {
    return <div className="loading-message">Loading resources...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  return (
    <div className="table-container">
      <table className="resource-table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Region</th>
            <th>Type</th> 
            <th>Status</th>
            <th>IP</th>
            <th>Created Time</th>
          </tr>
        </thead>
        <tbody>
          {Array.isArray(resources) ? (
            resources.map((resource, index) => (
              <tr key={resource.name} className={index % 2 === 0 ? 'even-row' : 'odd-row'}>
                <td>{resource.name}</td>
                <td>{resource.zone}</td>
                <td>{resource.type}</td> 
                <td>{resource.status || 'N/A'}</td>
                <td>{resource.ipAddresses && resource.ipAddresses.length > 0 ? resource.ipAddresses.join(', ') : 'N/A'}</td>
                <td>{resource.creationTimestamp || 'N/A'}</td>
              </tr>
            ))
          ) : (
            // If it's a single resource, display it directly
            <tr>
              <td>{resources.name}</td>
              <td>{resources.zone}</td>
              <td>{resources.type}</td>
              <td>{resources.status || 'N/A'}</td>
              <td>{resources.ipAddresses && resources.ipAddresses.length > 0 ? resources.ipAddresses.join(', ') : 'N/A'}</td>
              <td>{resources.creationTimestamp || 'N/A'}</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default ResourceTable;
